import React from 'react';
import { Link } from 'react-router-dom';
function Footer() {
  return (
    <div className='footer'>
      <p></p>

      <Link
        to={{
          pathname: 'https://github.com/Sebastiangomezzz',
        }}
        target='_blank'
      >
        <i class='fab fa-github'>Github</i>
      </Link>
    </div>
  );
}

export default Footer;
